def aupto(n):
  alst, astr, used, strind = [1], "1", {1}, 0
  for k in range(1, n):
    while astr[strind] == "0": strind += 1
    ak = digit = int(astr[strind])
    while ak in used: ak += digit
    alst.append(ak); astr += str(ak); used.add(ak); strind += 1
  return alst    # use alst[n-1] for a(n)
